import Login from '../Login/Login'
import Page404 from '../Page404/Page404'

function App() {
  return (
    <div className="page">
      <div className="page_container">
      <Routes>
      <Route path='/signup' element={<Register/>}>
      </Route>
      <Route path='/signin' element={<Login/>}>
      </Route>
      <Route path="*" element={<Page404/>}>

            </Route>
      </Routes>
      </div>
    </div>
  );
}

export default App;
